import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import userDataService from '../services/userDataService';
import './Pages.css';

const OrderHistory = () => {
  const orders = [
    {
      id: 'WK001',
      dish: 'Margherita Pizza',
      date: '2025-07-29',
      status: 'Delivered',
      total: '$45.99',
      ingredients: ['Mozzarella', 'Tomato Sauce', 'Basil', 'Flour']
    },
    {
      id: 'WK002', 
      dish: 'Chicken Tikka Masala',
      date: '2025-07-28',
      status: 'Delivered',
      total: '$38.50',
      ingredients: ['Chicken', 'Yogurt', 'Spices', 'Rice']
    }
  ];

  return (
    <div className="page-container">
      <div className="page-header">
        <Link to="/" className="back-button">
          ‚Üê Back to Home
        </Link>
        <h1>Order History</h1>
      </div>

      <div className="page-content">
        {orders.length > 0 ? (
          <div className="orders-list">
            {orders.map((order) => (
              <div key={order.id} className="order-card">
                <div className="order-header">
                  <h3>{order.dish}</h3>
                  <span className={`status-badge ${order.status.toLowerCase()}`}>
                    {order.status}
                  </span>
                </div>

                <div className="order-details">
                  <p><strong>Order ID:</strong> {order.id}</p>
                  <p><strong>Date:</strong> {order.date}</p>
                  <p><strong>Total:</strong> {order.total}</p>
                </div>

                <div className="ingredients-section">
                  <h4>Ingredients Delivered:</h4>
                  <div className="ingredients-tags">
                    {order.ingredients.map((ingredient, index) => (
                      <span key={index} className="ingredient-tag">
                        {ingredient}
                      </span>
                    ))}
                  </div>
                </div>

                <div className="order-actions">
                  <button className="action-button">Reorder</button>
                  <button className="action-button secondary">View Details</button>
                </div>
              </div>
            ))}
          </div>
        ) : (
          <div className="empty-state">
            <div className="empty-icon">üì¶</div>
            <h3>No Orders Yet</h3>
            <p>Your completed orders will appear here</p>
            <Link to="/" className="cta-button">
              Start Your First Order
            </Link>
          </div>
        )}
      </div>
    </div>
  );
};

export default OrderHistory;
